import React, { useState } from "react";
import "../resource/styles/detailmessageuser.css";
import arownBack from "../resource/svg/chat/message/message/detailMessageUser/arownBack.svg";
import addGroup from "../resource/svg/chat/message/message/detailMessageUser/groupAdd.svg";
import avatar from "../resource/img/avatar.png";
import search from "../resource/svg/chat/message/message/detailMessageUser/search.svg";
import webcame from "../resource/svg/chat/message/message/detailMessageUser/webcame.svg";
import more from "../resource/svg/chat/message/more.svg";
import sticker from "../resource/svg/chat/message/message/detailMessageUser/sticker.svg";
import image from "../resource/svg/chat/message/message/detailMessageUser/image.svg";
import attach from "../resource/svg/chat/message/message/detailMessageUser/attach.svg";
import screenCapture from "../resource/svg/chat/message/message/detailMessageUser/screenCapture.svg";
import businessCard from "../resource/svg/chat/message/message/detailMessageUser/businessCard.svg";
import clock from "../resource/svg/chat/message/message/detailMessageUser/clock.svg";
import toDoMission from "../resource/svg/chat/message/message/detailMessageUser/toDoMission.svg";
import chamthan from "../resource/svg/chat/message/message/detailMessageUser/chamthan.svg";
import fastMessage from "../resource/svg/chat/message/message/detailMessageUser/fastMessage.svg";
import emotion from "../resource/svg/chat/message/message/detailMessageUser/emotion.svg";
import like from "../resource/svg/chat/message/message/detailMessageUser/like.svg";
import penEditing from "../resource/svg/chat/message/message/detailMessageUser/penEditing.svg";
import bell from "../resource/svg/chat/message/message/detailMessageUser/bell.svg";
import pushPin from "../resource/svg/chat/message/message/detailMessageUser/pushpin.svg";
import anhchung1 from "../resource/img/message/messsage/detailmessage/anhchung1.png";
import anhchung2 from "../resource/img/message/messsage/detailmessage/anhchung2.png";
import anhchung3 from "../resource/img/message/messsage/detailmessage/anhchung3.png";
import anhchung4 from "../resource/img/message/messsage/detailmessage/anhchung4.png";
import anhchung5 from "../resource/img/message/messsage/detailmessage/anhchung5.png";
import anhchung6 from "../resource/img/message/messsage/detailmessage/anhchung6.png";
import anhchung7 from "../resource/img/message/messsage/detailmessage/anhchung7.png";
import tamgiac from "../resource/svg/chat/message/message/detailMessageUser/tamgiac.svg";
import lock from "../resource/svg/chat/message/message/detailMessageUser/lock.svg";
import clockMess from "../resource/svg/chat/message/message/detailMessageUser/clockMess.svg";
import visibility from "../resource/svg/chat/message/message/detailMessageUser/visibility.svg";
import warning from "../resource/svg/chat/message/message/detailMessageUser/warning.svg";
import trash from "../resource/svg/chat/message/message/detailMessageUser/trash.svg";

function DetailMessageUser() {
  const data_user = {
    avatar: avatar,
    message: "Chang quy ve si za handle button melogin handle console.log",
    username: "Kim Young Jung",
    lastTime: "3 giờ",
    timmer: "21:09 11/12/2023",
    messageTime: "8:29",
  };
  const data_message = {
    avatar: avatar,
    message:
      "Chang quy ve si za handle button melogin handle button cddddddđole choice storage and backup soliuton",
    messageTime: "8:31",
  };
  const data_messages = Array.from({ length: 20 }, () => data_message);

  return (
    <>
      <div className="flex">
        <div className="contains-interface">
          <div className="header-container flex">
            <div className="left-header flex">
              <div className="flex">
                <img className="right-icon-arowback" src={arownBack} alt="" />
                <img
                  className="right-img-avatar"
                  src={data_user.avatar}
                  alt=""
                />
                <div className="user-infor">
                  <h5>{data_user.username}</h5>
                  <p>{`Truy cập ${data_user.lastTime} trước`}</p>
                </div>
              </div>
            </div>
            <div className="right-header flex">
              <img
                className="right-icon-group"
                src={addGroup}
                alt="add-group"
              />
              <img className="right-icon-search" src={search} alt="search" />
              <img className="right-icon-webcam" src={webcame} alt="webcam" />
            </div>
          </div>

          <div className="center-container">
            <ul>
              {data_messages.map((userMessage, index) => (
                <li key={index}>
                  <div>
                    <div className="contains-mess flex">
                      <div className="user-img-avatar">
                        <img src={userMessage.avatar} alt="" />
                      </div>
                      <div className="user-message-avatar">
                        <p className="message-detail">{userMessage.message}</p>
                        <p className="message-timer">
                          {userMessage.messageTime}
                        </p>
                      </div>
                    </div>
                    <div className="contains-mess my-message-text flex">
                      <div className="user-message-avatar">
                        <p className="message-detail">{userMessage.message}</p>
                        <p className="message-timer">
                          {userMessage.messageTime}
                        </p>
                      </div>
                    </div>
                  </div>
                </li>
              ))}
            </ul>
          </div>

